function Tags(){}Tags.get=function(e,t,n){if(typeof n!=="boolean"){n=true}if(typeof e==="object"){for(var r in e){e[r]=this.get(e[r],t,n)}}else if(typeof e==="string"){e=this.replaceTags(e,t,n)}return e};Tags.replaceTags=function(e,t,n){return e.replace(/{{(.*?)}}/g,function(e,r){var i=false;if(typeof t[r]==="string"){i=t[r]}if(typeof i==="string"){return i}else if(n){return""}else{return e}})}